BEGIN        
	SELECT        
	TM_VENTA.VENT_ID, 
	TM_VENTA.CLI_RUC, 
	TM_VENTA.CLI_DIRECC, 
	TM_VENTA.CLI_CORREO, 
	TM_VENTA.VENT_SUBTOTAL, 
