	TM_EMPRESA.EMP_CORREO, 
	TM_EMPRESA.EMP_TELF, 
	TM_EMPRESA.EMP_DIRECC, 
	TM_EMPRESA.EMP_PAG, 
	TM_COMPANIA.COM_NOM, 
	TM_USUARIO.USU_CORREO, 
	TM_USUARIO.USU_NOM, 
	TM_USUARIO.USU_APE, 
	TM_USUARIO.USU_DNI, 
	TM_USUARIO.USU_TELF, 
	TM_USUARIO.USU_IMG, 
	TM_ROL.ROL_NOM, 
	TM_PAGO.PAG_NOM, 
	TM_MONEDA.MON_NOM, 
	TM_CLIENTE.CLI_NOM, 
	TM_DOCUMENTO.DOC_NOM, 
	TM_DOCUMENTO.DOC_TIPO
	FROM            
	TM_VENTA INNER JOIN
	TM_SUCURSAL ON TM_VENTA.SUC_ID = TM_SUCURSAL.SUC_ID INNER JOIN
	TM_EMPRESA ON TM_SUCURSAL.EMP_ID = TM_EMPRESA.EMP_ID INNER JOIN
