CREATE PROCEDURE [dbo].[SP_L_VENTA_06]
@SUC_ID INT
AS
BEGIN
	SELECT 
	CONVERT(VARCHAR,FECH_CREA,103) AS FECH_CREA,
	SUM(VENT_TOTAL) AS VENT_TOTAL
	FROM TM_VENTA 
	WHERE 
	EST=1
	AND SUC_ID = @SUC_ID
	GROUP BY 
	CONVERT(VARCHAR,FECH_CREA,103)
END
